var encr = "";

function convert() {
	try {
		var body = document.getElementById("mybody");
		var inp = document.getElementById("myinput").value;
		var decr = CryptoJS.AES.decrypt(encr, inp);
		console.log(decr.toString(CryptoJS.enc.Utf8));
		body.innerHTML = decr.toString(CryptoJS.enc.Utf8);
	}
	catch (e) {
		var err = document.getElementById("err");
		err.style.display = "block";
	}
}
